import React, { useEffect, useState, useCallback, useMemo } from "react";


function List(){
const[produtos,SetProdutos]=useState([])

useEffect(()=>{
const prods=localStorage.getItem("produtos");
console.log(prods);
SetProdutos(prods);

},[])
return <div> </div>

}
export default List;
